INSERT INTO public.data_contracts VALUES (4, 'GWRSAVFMjXx8HpQFaNJMqBV7MBgMK4br5UESsB4S31Ec', '{"domain": {"type": "object", "indices": [{"name": "parentNameAndLabel", "unique": true, "properties": [{"normalizedParentDomainName": "asc"}, {"normalizedLabel": "asc"}]}, {"name": "dashIdentityId", "unique": true, "properties": [{"records.dashUniqueIdentityId": "asc"}]}, {"name": "dashAlias", "properties": [{"records.dashAliasIdentityId": "asc"}]}], "$comment": "In order to register a domain you need to create a preorder. The preorder step is needed to prevent man-in-the-middle attacks. normalizedLabel + ''.'' + normalizedParentDomain must not be longer than 253 chars length as defined by RFC 1035. Domain documents are immutable: modification and deletion are restricted", "required": ["label", "normalizedLabel", "normalizedParentDomainName", "preorderSalt", "records", "subdomainRules"], "properties": {"label": {"type": "string", "pattern": "^[a-zA-Z0-9][a-zA-Z0-9-]{0,61}[a-zA-Z0-9]$", "position": 0, "maxLength": 63, "minLength": 3, "description": "Domain label. e.g. ''Bob''."}, "records": {"type": "object", "$comment": "Constraint with max and min properties ensure that only one identity record is used - either a `dashUniqueIdentityId` or a `dashAliasIdentityId`", "position": 5, "properties": {"dashAliasIdentityId": {"type": "array", "$comment": "Must be equal to the document owner", "maxItems": 32, "minItems": 32, "position": 1, "byteArray": true, "description": "Identity ID to be used to create alias names for the Identity", "contentMediaType": "application/x.dash.dpp.identifier"}, "dashUniqueIdentityId": {"type": "array", "$comment": "Must be equal to the document owner", "maxItems": 32, "minItems": 32, "position": 0, "byteArray": true, "description": "Identity ID to be used to create the primary name the Identity", "contentMediaType": "application/x.dash.dpp.identifier"}}, "maxProperties": 1, "minProperties": 1, "additionalProperties": false}, "preorderSalt": {"type": "array", "maxItems": 32, "minItems": 32, "position": 4, "byteArray": true, "description": "Salt used in the preorder document"}, "subdomainRules": {"type": "object", "position": 6, "required": ["allowSubdomains"], "properties": {"allowSubdomains": {"type": "boolean", "$comment": "Only the domain owner is allowed to create subdomains for non top-level domains", "position": 0, "description": "This option defines who can create subdomains: true - anyone; false - only the domain owner"}}, "description": "Subdomain rules allow domain owners to define rules for subdomains", "additionalProperties": false}, "normalizedLabel": {"type": "string", "pattern": "^[a-hj-km-np-z0-9][a-hj-km-np-z0-9-]{0,61}[a-hj-km-np-z0-9]$", "$comment": "Must be equal to the label in lowercase. \"o\", \"i\" and \"l\" must be replaced with \"0\" and \"1\".", "position": 1, "maxLength": 63, "description": "Domain label converted to lowercase for case-insensitive uniqueness validation. \"o\", \"i\" and \"l\" replaced with \"0\" and \"1\" to mitigate homograph attack. e.g. ''b0b''"}, "parentDomainName": {"type": "string", "pattern": "^$|^[a-zA-Z0-9][a-zA-Z0-9-]{0,61}[a-zA-Z0-9]$", "position": 2, "maxLength": 63, "minLength": 0, "description": "A full parent domain name. e.g. ''dash''."}, "normalizedParentDomainName": {"type": "string", "pattern": "^$|^[a-hj-km-np-z0-9][a-hj-km-np-z0-9-\\.]{0,61}[a-hj-km-np-z0-9]$", "$comment": "Must either be equal to an existing domain or empty to create a top level domain. \"o\", \"i\" and \"l\" must be replaced with \"0\" and \"1\". Only the data contract owner can create top level domains.", "position": 3, "maxLength": 63, "minLength": 0, "description": "A parent domain name in lowercase for case-insensitive uniqueness validation. \"o\", \"i\" and \"l\" replaced with \"0\" and \"1\" to mitigate homograph attack. e.g. ''dash''"}}, "additionalProperties": false}, "preorder": {"type": "object", "indices": [{"name": "saltedHash", "unique": true, "properties": [{"salt